import React from 'react';
import {withRouter} from 'react-router-dom'

const Post = props => {
  const text = props.body
  text = text.charAt(0).toUpperCase() + text.slice(1)
  return (
    <div className={'Post'}>
      <h3>{props.title}</h3>
      <p>{text}</p>
    </div>
  )
}

export default Post
